import * as assert from 'assert';
import { FoldingRange } from 'vscode';
import { createFoldingRanges, LogState, parseGitHubLog } from '../extension.bundle';

suite('Parse response from GitHub downloadJobLogsForWorkflowRun API', () => {
    test('01 - Parse the entire job log', (() => {
        const rawLogs: string = decodeURI(rawEncodedLogs);
        const startedAt: string = '2021-06-28T17:04:11Z';
        const completedAt: string = '2021-06-28T17:06:43Z';

        const actualLogState: LogState = parseGitHubLog(rawLogs, new Date(startedAt), new Date(completedAt));
        assert.deepStrictEqual(actualLogState, expectedLogState01);
    }));

    test('02 - Parse a step of the job log that has overlapping log entries', (() => {
        const rawLogs: string = decodeURI(rawEncodedLogs);
        const startedAt: string = "2021-06-28T10:05:23.000-07:00";
        const completedAt: string = "2021-06-28T10:06:42.000-07:00";

        // uses isOverlappingStep
        const actualLogState: LogState = parseGitHubLog(rawLogs, new Date(startedAt), new Date(completedAt));
        assert.deepStrictEqual(actualLogState, expectedLogState02);
    }));

    test('03 - Parse job log where no entries are within the timestamps', (() => {
        const rawLogs: string = decodeURI(rawEncodedLogs);
        const startedAt: string = '2020-06-28T17:04:11Z';
        const completedAt: string = '2020-06-28T17:06:43Z';

        const actualLogState: LogState = parseGitHubLog(rawLogs, new Date(startedAt), new Date(completedAt));
        assert.deepStrictEqual(actualLogState, expectedLogState03);
    }));

    test('04 - Parse job log where invalid timestamps are parameters', (() => {
        const rawLogs: string = decodeURI(rawEncodedLogs);
        const invalidTimestamp: string = 'invalid_timestamps';
        const actualLogState: LogState = parseGitHubLog(rawLogs, new Date(invalidTimestamp), new Date(invalidTimestamp));
        assert.deepStrictEqual(actualLogState, expectedLogState03);
    }));

    test('05 - Create folding ranges for the entire job log', (() => {
        const actualFoldingRange = createFoldingRanges(expectedLogState01);
        assert.deepStrictEqual(actualFoldingRange, expectedFoldingRange01.map(fr => mapGenericObjectToFoldingRange(fr.start, fr.end, fr.kind)))
    }));

    test('06 - Create folding ranges for a step in the middle of the job log', (() => {
        const actualFoldingRange = createFoldingRanges(expectedLogState02);
        assert.deepStrictEqual(actualFoldingRange, expectedFoldingRange02.map(fr => mapGenericObjectToFoldingRange(fr.start, fr.end, fr.kind)));
    }));

    test('07 - Create folding ranges when LogState is empty', (() => {
        const actualFoldingRange = createFoldingRanges(expectedLogState03);
        assert.deepStrictEqual(actualFoldingRange, [])
    }));
});

function mapGenericObjectToFoldingRange(start: number, end: number, kind: number | undefined) {
    return new FoldingRange(start, end, kind);
}

